 * To view and modify this theme, visit http://jqueryui.com/themeroller/?ffDefault=Helvetica,%20sans-serif&fwDefault=bold&fsDefault=1.2em&cornerRadius=4px&bgColorHeader=c3e8f4&bgTextureHeader=03_highlight_soft.png&bgImgOpacityHeader=75&borderColorHeader=1f295b&fcHeader=1f295b&iconColorHeader=1f295b&bgColorContent=ffffff&bgTextureContent=01_flat.png&bgImgOpacityContent=75&borderColorContent=1f295b&fcContent=1f295b&iconColorContent=1f295b&bgColorDefault=c3e8f4&bgTextureDefault=02_glass.png&bgImgOpacityDefault=75&borderColorDefault=c3e8f4&fcDefault=1f295b&iconColorDefault=1f295b&bgColorHover=ffffff&bgTextureHover=02_glass.png&bgImgOpacityHover=75&borderColorHover=1f295b&fcHover=1f295b&iconColorHover=1f295b&bgColorActive=1f295b&bgTextureActive=02_glass.png&bgImgOpacityActive=65&borderColorActive=c3e8f4&fcActive=c3e8f4&iconColorActive=c3e8f4&bgColorHighlight=fddc40&bgTextureHighlight=02_glass.png&bgImgOpacityHighlight=55&borderColorHighlight=1f295b&fcHighlight=1f295b&iconColorHighlight=1f295b&bgColorError=fddc40&bgTextureError=05_inset_soft.png&bgImgOpacityError=95&borderColorError=cd0a0a&fcError=cd0a0a&iconColorError=cd0a0a&bgColorOverlay=aaaaaa&bgTextureOverlay=01_flat.png&bgImgOpacityOverlay=0&opacityOverlay=30&bgColorShadow=aaaaaa&bgTextureShadow=01_flat.png&bgImgOpacityShadow=0&opacityShadow=30&thicknessShadow=8px&offsetTopShadow=-8px&offsetLeftShadow=-8px&cornerRadiusShadow=8px
 */


/* Component containers
----------------------------------*/
.ui-widget { font-family: "Lucida Grande", arial, sans-serif; font-size: 12px; }
.ui-widget .ui-widget { font-size: 12px; }
.ui-widget input, .ui-widget select, .ui-widget textarea, .ui-widget button { font-family: Helvetica, sans-serif; font-size: 12px; }
.ui-widget-content { border: 1px solid #ffffff; background: #ffffff; color: #000000; }
.ui-widget-content a { color: #414042; }
.ui-widget-header { border: 1px solid #ffffff; background: #ffffff; color: #A70D12; font-weight: bold; }
.ui-widget-header a { color: #A70D12; }

/* Interaction states
----------------------------------*/
.ui-state-default, .ui-widget-content .ui-state-default, .ui-widget-header .ui-state-default { border: 1px solid #ffffff; background: #ffffff; font-weight: bold; color: #A70D12; }
.ui-state-default a, .ui-state-default a:link, .ui-state-default a:visited { color: #000000; text-decoration: none; }
.ui-state-hover, .ui-widget-content .ui-state-hover, .ui-widget-header .ui-state-hover, .ui-state-focus, .ui-widget-content .ui-state-focus, .ui-widget-header .ui-state-focus { border: 1px solid #000000; background: #ffffff; font-weight: bold; color: #000000; }
.ui-state-hover a, .ui-state-hover a:hover { color: #414042; text-decoration: none; }
.ui-state-active, .ui-widget-content .ui-state-active, .ui-widget-header .ui-state-active { border: 1px solid #414042; background: #414042; font-weight: bold; color: #ffffff; }
.ui-state-active a, .ui-state-active a:link, .ui-state-active a:visited { color: #ffffff; text-decoration: none; }
.ui-widget :active { outline: none; }

/* Interaction Cues
----------------------------------*/
.ui-state-highlight, .ui-widget-content .ui-state-highlight, .ui-widget-header .ui-state-highlight  {border: 1px solid #414042; background: #ffffff url(images/ui-bg_glass_55_fddc40_1x400.png) 50% 50% repeat-x; color: #111111; }
.ui-state-highlight a, .ui-widget-content .ui-state-highlight a,.ui-widget-header .ui-state-highlight a { color: #111111; }
.ui-state-error, .ui-widget-content .ui-state-error, .ui-widget-header .ui-state-error {border: 1px solid #cd0a0a; background: #fddc40 url(images/ui-bg_inset-soft_95_fddc40_1x100.png) 50% bottom repeat-x; color: #cd0a0a; }
.ui-state-error a, .ui-widget-content .ui-state-error a, .ui-widget-header .ui-state-error a { color: #cd0a0a; }
.ui-state-error-text, .ui-widget-content .ui-state-error-text, .ui-widget-header .ui-state-error-text { color: #111111; }
.ui-priority-primary, .ui-widget-content .ui-priority-primary, .ui-widget-header .ui-priority-primary { font-weight: bold; }
.ui-priority-secondary, .ui-widget-content .ui-priority-secondary,  .ui-widget-header .ui-priority-secondary { opacity: .7; filter:Alpha(Opacity=70); font-weight: normal; }
.ui-state-disabled, .ui-widget-content .ui-state-disabled, .ui-widget-header .ui-state-disabled { opacity: .35; filter:Alpha(Opacity=35); background-image: none; }

/* Icons
----------------------------------*/

/* states and images */
.ui-icon { width: 16px; height: 16px; background: url(../images/btn_arrowdate01.png) 0px 0px no-repeat;}
.ui-icon:hover { background-position: 0px -16px;}
.ui-icon-circle-triangle-e { background-position: 0px -32px; }
.ui-icon-circle-triangle-e:hover { background-position: 0px -48px; }


/* Misc visuals
----------------------------------*/

/* Overlays */
.ui-widget-overlay { background: #aaaaaa url(images/ui-bg_flat_0_aaaaaa_40x100.png) 50% 50% repeat-x; opacity: .30;filter:Alpha(Opacity=30); }
.ui-widget-shadow { margin: -8px 0 0 -8px; padding: 8px; background: #aaaaaa url(images/ui-bg_flat_0_aaaaaa_40x100.png) 50% 50% repeat-x; opacity: .30;filter:Alpha(Opacity=30); -moz-border-radius: 8px; -webkit-border-radius: 8px; border-radius: 8px; }/*
 * jQuery UI Datepicker 1.8.6
 *
 * Copyright 2010, AUTHORS.txt (http://jqueryui.com/about)
 * Dual licensed under the MIT or GPL Version 2 licenses.
 * http://jquery.org/license
 *
 * http://docs.jquery.com/UI/Datepicker#theming
 */
.ui-datepicker { width: 17em; padding: .2em .2em 0; }
.ui-datepicker .ui-datepicker-header { position:relative; padding:.2em 0; }
.ui-datepicker .ui-datepicker-prev, .ui-datepicker .ui-datepicker-next { position:absolute; top: 2px; width: 1.8em; height: 1.8em; }
.ui-datepicker .ui-datepicker-prev-hover, .ui-datepicker .ui-datepicker-next-hover { top: 1px; }
.ui-datepicker .ui-datepicker-prev { left:2px; }
.ui-datepicker .ui-datepicker-next { right:2px; }
.ui-datepicker .ui-datepicker-prev-hover { left:1px; }
.ui-datepicker .ui-datepicker-next-hover { right:1px; }
.ui-datepicker .ui-datepicker-prev span, .ui-datepicker .ui-datepicker-next span { display: block; position: absolute; left: 50%; margin-left: -8px; top: 50%; margin-top: -8px;  }
.ui-datepicker .ui-datepicker-title { margin: 0 2.3em; line-height: 1.8em; text-align: center; }
.ui-datepicker .ui-datepicker-title select { font-size:1em; margin:1px 0; }
.ui-datepicker select.ui-datepicker-month-year {width: 100%;}
.ui-datepicker select.ui-datepicker-month, 
.ui-datepicker select.ui-datepicker-year { width: 49%;}
.ui-datepicker table {width: 100%; font-size: .9em; border-collapse: collapse; margin:0 0 .4em; }
.ui-datepicker th { padding: .7em .3em; text-align: center; font-weight: bold; border: 0;  }
.ui-datepicker td { border: 0; padding: 1px; }
.ui-datepicker td span, .ui-datepicker td a { display: block; padding: .2em; text-align: right; text-decoration: none; }
.ui-datepicker .ui-datepicker-buttonpane { background-image: none; margin: .7em 0 0 0; padding:0 .2em; border-left: 0; border-right: 0; border-bottom: 0; }
.ui-datepicker .ui-datepicker-buttonpane button { float: right; margin: .5em .2em .4em; cursor: pointer; padding: .2em .6em .3em .6em; width:auto; overflow:visible; }
.ui-datepicker .ui-datepicker-buttonpane button.ui-datepicker-current { float:left; }

/* with multiple calendars */
.ui-datepicker.ui-datepicker-multi { width:auto; }
.ui-datepicker-multi .ui-datepicker-group { float:left; }
.ui-datepicker-multi .ui-datepicker-group table { width:95%; margin:0 auto .4em; }
.ui-datepicker-multi-2 .ui-datepicker-group { width:50%; }
.ui-datepicker-multi-3 .ui-datepicker-group { width:33.3%; }
.ui-datepicker-multi-4 .ui-datepicker-group { width:25%; }
.ui-datepicker-multi .ui-datepicker-group-last .ui-datepicker-header { border-left-width:0; }
.ui-datepicker-multi .ui-datepicker-group-middle .ui-datepicker-header { border-left-width:0; }
.ui-datepicker-multi .ui-datepicker-buttonpane { clear:left; }
.ui-datepicker-row-break { clear:both; width:100%; }

/* RTL support */
.ui-datepicker-rtl { direction: rtl; }
.ui-datepicker-rtl .ui-datepicker-prev { right: 2px; left: auto; }
.ui-datepicker-rtl .ui-datepicker-next { left: 2px; right: auto; }
.ui-datepicker-rtl .ui-datepicker-prev:hover { right: 1px; left: auto; }
.ui-datepicker-rtl .ui-datepicker-next:hover { left: 1px; right: auto; }
.ui-datepicker-rtl .ui-datepicker-buttonpane { clear:right; }
.ui-datepicker-rtl .ui-datepicker-buttonpane button { float: left; }
.ui-datepicker-rtl .ui-datepicker-buttonpane button.ui-datepicker-current { float:right; }
.ui-datepicker-rtl .ui-datepicker-group { float:right; }
.ui-datepicker-rtl .ui-datepicker-group-last .ui-datepicker-header { border-right-width:0; border-left-width:1px; }
.ui-datepicker-rtl .ui-datepicker-group-middle .ui-datepicker-header { border-right-width:0; border-left-width:1px; }

/* IE6 IFRAME FIX (taken from datepicker 1.5.3 */
.ui-datepicker-cover {
    display: none; /*sorry for IE5*/
    display/**/: block; /*sorry for IE5*/
    position: absolute; /*must have*/
    z-index: -1; /*must have*/
    filter: mask(); /*must have*/
    top: -4px; /*must have*/
    left: -4px; /*must have*/
    width: 200px; /*must have*/
    height: 200px; /*must have*/
}
.ui-widget { display: none; }

/******FONTS*****/
/****MIXINS*****/
@font-face {
  font-family: 'ostrich_sansblack';
  src: url('../fonts/ostrich-black-webfont.eot');
  src: url('../fonts/ostrich-black-webfont.eot?#iefix') format('embedded-opentype'), url('../fonts/ostrich-black-webfont.woff') format('woff'), url('../fonts/ostrich-black-webfont.ttf') format('truetype'), url('../fonts/ostrich-black-webfont.svg#ostrich_sansblack') format('svg');
  font-weight: normal;
  font-style: normal;
}
@font-face {
  font-family: 'ostrich_sans_roundedmedium';
  src: url('../fonts/ostrich-rounded-webfont.eot');
  src: url('../fonts/ostrich-rounded-webfont.eot?#iefix') format('embedded-opentype'), url('../fonts/ostrich-rounded-webfont.woff') format('woff'), url('../fonts/ostrich-rounded-webfont.ttf') format('truetype'), url('../fonts/ostrich-rounded-webfont.svg#ostrich_sans_roundedmedium') format('svg');
  font-weight: normal;
  font-style: normal;
}
html {
  font-family: Helvetica, sans-serif;
  font-weight: lighter;
}
body {
  background: #ffffff;
  margin: 0px;
  padding: 0px;
  background: #ffffff url(../images/bg_body.png) center center repeat;
  min-height: 100vh;
}
h1,
h2 {
  font-family: 'ostrich_sans_roundedmedium';
  text-transform: uppercase;
  text-align: center;
  color: #262425;
  font-size: 30px;
  line-height: 30px;
  margin: 10px 0px 20px 0px;
  font-weight: normal;
}
h2 {
  font-family: 'ostrich_sansblack';
  color: #a70d12;
  font-size: 30px;
  line-height: 30px;
  text-align: left;
  margin: 0px 0px 10px 0px;
}
.text h2 {
  margin: 50px 0px 10px 0px;
}
p {
  font-size: 15px;
  line-height: 20px;
  color: #262425;
  padding: 0px;
  margin: 0px 0px 10px 0px;
  width: 100%;
}
p.center,
p.supercenter {
  text-align: center;
}
li {
  font-size: 15px;
  line-height: 15px;
}
a {
  color: #a70d12;
  text-decoration: none;
  outline: none;
}
a:hover {
  color: #262425;
  cursor: pointer;
}
.container {
  width: 90%;
  padding: 0px;
  margin: 0px auto;
  float: none;
  display: block;
  overflow: auto;
}
.menu img,
ul.locationtab,
ul.locationtab li,
.contact-container,
.connect-container,
input,
textarea,
select,
.recipe img,
.main.home img,
p.recipes_found,
.text p img,
.container.home-footer {
  box-sizing: border-box;
  -moz-box-sizing: border-box;
  -webkit-box-sizing: border-box;
}
.btn,
.btn_submit, .button {
  font-size: 15px;
  line-height: 15px;
  text-transform: uppercase;
  text-align: center;
  display: block;
  float: left;
  clear: both;
  margin: 10px 0px;
  padding: 10px 20px;
  background: #a70d12 /*url(../images/bg_01.jpg) center center repeat*/;
  color: #ffffff;
  border-radius: 11px;
  cursor: pointer;
  -webkit-transition: background 0.3s ease-in;
  -moz-transition: background 0.3s ease-in;
  -o-transition: background 0.3s ease-in;
  transition: background 0.3s ease-in;
}
.btn:hover,
.btn_submit:hover {
  background: #262425 center center repeat;
  color: #ffffff;
}
.btn.center,
.btn_submit.center {
  float: none !important;
  margin: 10px auto;
  max-width: 80px;
}
.btn.center.btn-large {
	max-width: 200px;
}
.height_marker {
  display: block;
  height: auto;
  min-height:650px;
  overflow: visible;
}
.screen {
  background: url(../images/bg_screen.png) 0px 0px repeat;
  width: 100%;
  height: 100%;
  display: none;
  margin: 0px;
  padding: 0px;
  position: absolute;
  z-index: 555555;
  top: 0;
  left: 0;
}
.mobilehide {
  display: none;
}
.mobileshow {
  display: inline-block;
}
.text p img {
  width: 100%;
  height: auto;
  border: 1px solid #262425;
}
#mobiletrue {
  width: 1px;
  height: 1px;
  display: block;
  background: #a70d12;
  position: absolute;
  z-index: -22;
  bottom: 0px;
  left: 0px;
}
/*=========================================*/
/* HEADER                                                                                  
/*=========================================*/
header {
  width: 100%;
  height: auto;
  padding: 8px 0px 20px 0px;
  margin: 0px;
  display: block;
  overflow: auto;
  float: left;
  clear: none;
  text-align: center;
  border: solid #262425;
  background: #ffffff url(../images/bg_header_bottom.png) left bottom repeat-x;
  border-width: 0px 0px 1px 0px;
  position: fixed;
  z-index: 999999999;
  top: 0;
  left: 0;
}
.logo {
  width: 80px;
  height: auto;
  display: block;
  float: none;
  margin: 0px auto;
}
.btn_menu {
  width: 20px;
  height: 17px;
  display: block;
  background: url(../images/btn_menu.png) 0px 0px no-repeat;
  float: right;
  clear: none;
  margin: -26px 15px 0px 0px;
}
.logo img {
  width: 100%;
  height: auto;
}
.primary {
  display: none;
  margin: 30px 0px;
  text-transform: uppercase;
  text-align: center;
  width: 100%;
}
.primary span li {
  display: none;
}
.primary .btn_more {
  cursor: pointer;
}
.primary li {
  width: 100%;
  display: block;
  font-size: 15px;
  line-height: 15px;
  margin: 0px 0px 20px 0px;
  color: #a70d12;
  font-weight: lighter;
}
.primary li a {
  color: #a70d12;
}
.indicator {
  width: 18px;
  height: 0px;
  display: none;
  background: url(../images/bg_indicator.png) 0px 0px no-repeat;
  position: absolute;
  float: right;
  clear: none;
  right: 0;
  top: 0;
}
.anchor {
  width: 0px;
  height: 0px;
  float: left;
  clear: left;
  postion: relative;
}
.goodfood {
  color: #a70d12;
  font-size: 13px;
  line-height: 13px;
  text-transform: uppercase;
  margin-top: 40px;
}
/*.goodfood {
	color: @green;
	font-size: 18px;
	line-height: 18px;
	text-transform: uppercase;
	position: fixed;
	bottom: 20px;
	width: 240px;
	display: none;
}
.container.home .goodfood {
	width: 435px;
}*/
.home-copy {
  margin: 0px;
  border: none;
  background: #ffffff url(../images/bg_body.png) center center repeat;
  padding: 50px;
  box-shadow: none;
}
/*=========================================*/
/* MAIN                                                                                   
/*=========================================*/
.main {
  display: block;
  width: 100%;
  height: 100%;
  overflow: auto;
  margin: 70px 0px 0px 0px;
  padding: 0px;
}
/*=========================================*/
/* HOME                                                                                 
/*=========================================*/
.main.home {
  padding: 0px;
  width: auto;
  border-color: #262425;
  background: #262425;
  overflow: hidden;
  position: relative;
}
.main.home .photo_river {
  display: block;
  overflow: auto;
}
.main.home .photo_river .photo_set {
  display: block;
  overflow: auto;
  float: left;
  clear: both;
}
.main.home .photo_river .photo_set img {
  cursor: pointer;
}
.main.home .column {
  width: 103%;
  height: auto;
  float: left;
  clear: none;
}
.main.home img {
  width: 100%;
  height: auto;
  margin: 0px;
  padding: 0px;
  float: left;
  clear: none;
  border: solid #262425;
  border-width: 0px 10px 10px 0px;
}
.main.home .screen {
  width: 100%;
  height: 100%;
  display: none;
  background: url(../images/bg_screen.png) 0px 0px repeat;
  position: absolute;
}
.main.home .screen .img_container {
  width: 90%;
  height: auto;
  overflow: auto;
  display: block;
  margin: 50px auto;
  float: none;
  position: relative;
}
.main.home .screen .img_container img {
  width: 100%;
  height: auto;
  border: 1px solid #262425;
}
.main.home .screen .img_container .btn_close {
  width: auto;
  font-size: 12px;
  line-height: 12px;
  color: #FFF;
  cursor: pointer;
  float: right;
  margin: 0px 1px 4px 0px;
}
.main.home .screen .img_container .title {
  font-weight: lighter;
  text-transform: uppercase;
  text-align: center;
  color: #ffffff;
  font-size: 15px;
  line-height: 15px;
  padding-top: 20px;
  padding-bottom: 2px;
}
/*=========================================*/
/* MENUS                                                                                  
/*=========================================*/
ul.locationtab {
  width: 100%;
  /*max-width: 400px;*/
  display: block;
  background: #eae8e8;
  float: none;
  margin: 50px auto;
  padding: 0px;
  text-align: center;
  border: 2px solid #262425;
}
ul.locationtab li {
  text-align: center;
  padding: 5px 10px;
  margin: 5px 5px;
  text-transform: uppercase;
  box-sizing: border-box;
  font-size: 11px;
  line-height: 11px;
  cursor: pointer;
  border: 1px solid #eae8e8;
  border-radius: 9px;
}
ul.locationtab li.selected {
  background: #a70d12;
  border: 1px solid #262425;
  color: #ffffff;
}
.menu {
  display: block;
  float: left;
  clear: none;
  width: 100%;
  margin: 0px 0px 50px 0px;
  display: none;
  position: relative;
}
.menu.Illinois {
  display: block;
}
.menu img {
  width: 100%;
  height: auto;
  float: left;
  border: 1px solid #262425;
  margin: 0px 0px 20px 0px;
}
.menu .right {
  float: left;
  clear: none;
  width: 100%;
}
/*=========================================*/
/* LOCATIONS                                                                                  
/*=========================================*/
.menu .half {
  width: 100%;
  display: block;
  float: left;
  clear: left;
}
.menu .half p {
  display: block;
  float: left;
  clear: left;
  text-align: center;
}
.menu .half p.hours {
  font-size: 12px;
  text-align: center;
}
.contact-container,
.connect-container {
  width: 90%;
  height: auto;
  display: block;
  padding: 30px;
  float: none;
  margin: 50px auto;
  background: #ffffff;
  border: 5px solid #a70d12;
  position: relative;
  -moz-box-shadow: 0px 0px 10px 0px #262425;
  -webkit-box-shadow: 0px 0px 10px 0px #262425;
  box-shadow: 0px 0px 10px 0px #262425;
}
.contact-container h2,
.connect-container h2,
.contact-container p,
.connect-container p {
  text-align: center;
  font-size: 15px;
  line-height: 20px;
}
.contact-container .content-area,
.connect-container .content-area {
  display: block;
  width: 100%;
  height: auto;
  overflow: auto;
}
.btn_close_contact,
.btn_close_connect,
.btn_close_mobile {
  position: absolute;
  top: -22px;
  right: -4px;
  width: auto;
  font-size: 12px;
  line-height: 12px;
  color: #FFF;
  cursor: pointer;
}
.connect-container .left,
.connect-container .right {
  width: 100%;
  height: auto;
  display: block;
  float: left;
