function submitForm() {

		$('.btn_submit').click(function() {

			var onfail = false;
			var at = "@";
			var dot = ".";
			var formname = $(this).parent().attr('name');
			var thankyoumessage = $('form[name='+formname+'] input[alt=thankyoumessage]').val();
			var array = $('form[name='+formname+']').children('.formfield');
			var datastring = 'form='+formname;
      var location = 'contact';

			$.each(array, function(index, value) {
				var fname = $(this).attr('alt');
				var fval = $(this).val();

				if(fname == 'email') {
					if(fval == '' || fval.indexOf(at)==-1 || fval.indexOf(dot)==-1 || fval == null) {
						$('.'+formname+' [alt='+fname+']').addClass('onfail');
						onfail = true;
					} else {
						datastring += '&'+ fname +'='+ fval;
					}
				} else {
					if(fval == '' || fval == null || fval == 'Select Location') {
						$('.'+formname+' [alt='+fname+']').addClass('onfail');
						onfail = true;
					}
					else {
						datastring += '&'+ fname +'='+ fval;
					}
				}
			});

			if(onfail == false) {
				//alert(datastring);
				$.ajax({
					type: "POST",
					url: "../send.php",
					data: datastring,
					success: function() {
						$('.'+formname).html(thankyoumessage + '<iframe src="../thank-you/?'+formname+'" height="1" width="1" style="height: 1px; width: 1px; border: none; float: left; clear: left;"></p>').hide().fadeIn(1500, function() {
							$('.'+formname);
						});
					}
				});
				return false;
			}
		});






