	display:block;
	width:200px;
	height:100%;	
	padding:5px;
	border:solid 1px #999999;
	float:left;	
	margin-right:5px;
}
	

.my_meta_control .preview_box img{
	width:100%;
}

.repeater_box{
	margin:20px 0px 0px 0px;
}

.repeatable_field{
	border-radius:8px;
	padding:5px;
	background:#ececec;
	margin-bottom:5px;
}

.my_meta_control .repeater_btn{
	display:inline-block;
	font-size:10px;
	color:#CCC;
	background:#333;
	cursor:pointer;
	padding:5px 4px;
	margin:4px 0px;
	border-radius:3px;	
}

.my_meta_control .repeater_btn:hover{
	color:#fff;
}

.my_meta_control .remove span{
	display:inline-block;	
	color:#FF9;
}


.my_meta_control .add{
	background:#36C;
	margin-bottom:35px;	
}


.my_meta_control .add span{
	display:inline-block;	
	color:#0CF;
}

