$(document).ready(function() {

	//global vars
	var menunNavOpen = false;
	var moreoNavOpen = false;
	var StoreCode;


	if($('#mobiletrue:visible').length == 0){
		/*$(window).load(function() {
			//make header full window height
			var windowHeight = $('.container').height()-40;
			$('header').css('height',windowHeight+'px');
		});*/
	} else {

	}

	//Work Around for adding current class to list pages output when usng archives instead of pages
	var lasturl = window.location.pathname.replace(/\//g,'');
	if(lasturl == 'faqs') {
		lasturl = 'FAQs';
	} else {
		lasturl = lasturl.charAt(0).toUpperCase() + lasturl.slice(1);
	}
	$('ul.primary li a:contains('+lasturl+')').parent().addClass('current_page_item');
	console.log(lasturl);

	//first thing: check to see if we should open more nav
	if (localStorage.moreoNavOpen === 'true') {
		moreoNavOpen = true;
		$('.btn_more').hide();
		$('.primary span li').show();
	}

	//Main nav item indicator on ready
	if ($('li.current_page_item').length != 0) {
		var position = $('li.current_page_item').position();
		position  = position.top-11;
		$('.indicator').css({'top':position, 'display':'block'});
	}

	//menuNav funcitons (for mobile)
	function toggleMenuNav() {
		if(menunNavOpen == false) {
			$('header').animate({'height':'100%'}, 300, 'easeInOutSine', function() {
				menunNavOpen = true;
				$('ul.primary').fadeIn(200);
			});
		} else if(menunNavOpen == true) {
			$('ul.primary').fadeOut(100, function() {
				menunNavOpen = false;
				$('header').animate({'height':'32px'}, 300, 'easeInOutSine', function() {
					$('header').css('height','auto');
				});

			});
		}
	}

	//on more menu click (for mobile)
	$('.btn_menu').click(function() {
		toggleMenuNav();
	});
	//on more menu click
	$('.btn_more').click(function() {
		$(this).hide();
		$('.primary span li').fadeIn(300);
		localStorage.setItem('moreoNavOpen', 'true'); //we need to set this, to check if more should be open on load
	});

	//for location tab click
	$('ul.locationtab li').click(function() {
		$('ul.locationtab li').removeClass('selected');
		$(this).addClass('selected');
		var type = $(this).html();

		/*if(type == 'Edina & Ridgedale') {
			type = 'Minnesota';
		}
		if(type == 'Lincolnshire &<br>Schaumburg') {
			type = 'Lincolnshire';
		}*/
		/*if(type == '6 E. Cedar &<br>60 E. Ohio') {
			type = 'Illinois';
		}*/

		var oldHeight = $('.height_marker').height()+'px';
		var newHeight = 0;
		$('.menu.'+type).each(function(i, obj) {
			newHeight = newHeight+($(this).height())+50;
		});
		newHeight = newHeight+'px';
		$('.height_marker').css({'height':oldHeight});
		$('.menu').hide();

		$('.menu.'+type).delay(200).fadeIn(400);
		$('.height_marker').animate({'height':newHeight}, 300);
	});


	//Contact us
	$('a.contact-link').on('click', function(e) {
		//prevent default <a> behavior
		e.preventDefault();
		e.stopPropagation();


		//get position of link
		var offset = $(this).offset();
		var offsetDiff = 250;
		//check to see if last in collection
		var type = $(this).closest('article').attr('alt');
		if($(this).closest('article').is('.'+type+':last')) {
			offsetDiff = 350;
		}
		offset = (offset.top-offsetDiff)+'px';

		//get emails and store name
		var email = $(this).attr('data-email');
		var title = $(this).attr('data-title');
		$('input[alt="mailto"]').val(email);
		$('input[alt="subject"]').val('Big Bowl '+title+' Contact Us');
		$('.contact-container h2').html('Contact Big Bowl '+title);

		//offset top and fadeIn
		$('.contact-container').css('margin-top',offset);
		$('.contact-screen').fadeIn(300);

		//on btn close
		$('.btn_close_contact').click(function() {
			$('.contact-screen').fadeOut(300);
		});
	});

	//Connect With Big Bowl
	$('a.connect-link').on('click', function(e) {
		//prevent default <a> behavior
		e.preventDefault();
		e.stopPropagation();


		//get position of link
		var offset = $(this).offset();
		var offsetDiff = 400;
		//check to see if last in collection
		var type = $(this).closest('article').attr('alt');
		//if($(this).closest('article').is('.'+type+':last')) {
		//	offsetDiff = 650;
		//}
		offset = (offset.top-offsetDiff)+'px';

		//get emails and store name
		var title = $(this).attr('data-title');
		var aid = $(this).attr('data-aid');
		var sucode = $(this).attr('data-sucode');
		var facebook = $(this).attr('data-facebook');
		var twitter = $(this).attr('data-twitter');
		var gplus = $(this).attr('data-gplus');
		StoreCode = $(this).attr('data-storecode');

		//store in sessions

		//if no text club, then hide it
		if(aid == '') {
			$('.connect-container .left').hide();
			$('.connect-container .right').css('width', '100%');
		} else {
			$('.connect-container .left').show();
			$('.connect-container .right').css('width', '48%');
			var mobileBaseURL = $('#successurl').val();
			var socialInfoString = '&title='+title+'&aid='+aid+'&sucode='+sucode;
			$('input#successurl').val(mobileBaseURL+'?sent=true'+socialInfoString);
			$('input#failureurl').val(mobileBaseURL+'?sent=false'+socialInfoString);
		}

		//mobile values
		$('input#aid').val(aid);
		$('input#sucode').val(sucode);
		//social values
		$('.fb').attr('href',facebook);
		$('.tw').attr('href',twitter);
		$('.gp').attr('href', gplus);

		$('.connect-container h2').html('Connect with Big Bowl '+title);

		//offset top and fadeIn
		$('.connect-container').css('margin-top',offset);
		$('.connect-screen').fadeIn(300);

		//on btn close
		$('.btn_close_connect').click(function() {
			$('.connect-screen').fadeOut(300);
		});

		//show social btns, then hide ones without href
		$('.btn_social').show();
		$('.btn_social[href=]').hide();
	});

	//for mobile program close btn
	$('.btn_close_mobile').click(function() {
		$('.mobile-screen').fadeOut(300).html('');;
	});


	//Recipe Search
	//function for search filtering
	function search_recipes() {
		var searchterm = $('.recipe_search').val().toLowerCase();
		$('.menu.recipes').hide();
		var numberFound = 0;
		var numberPlural = 's';
		$('.menu.recipes[data-filter*="'+searchterm+'"]').fadeIn(300).each(function() {
			numberFound++;
		});
		if(numberFound == 1) {
			numberPlural = '';
		}
