	var windowHeight = $(window).height();
	var riverHeight = $('.photo_river').height();
	var riverCount = 1;
	var riverHtml = $('.photo_river').html();
	var riverTime = 0;
	var newtime = 0;
	var riverDuration = 16000; ///default value changed down below
	$('.main.home').css('height',windowHeight+'px');//set page height to equal browser window hieght


	//if photo columns unequal in height, adjust
	function evenColumns() {
		var colOneHeight = $('.column:first').height();
		var colTwoHeight = $('.column:last').height();
		var randomImage = $('.column:first img:nth-child(3)').attr('src');
		//$('.photo_set .column').css('background-image','url('+randomImage+')');
		if(colOneHeight > colTwoHeight) {
			$('.photo_set').css({'background':'url('+randomImage+') right 10px bottom 10px no-repeat','background-size':'50%'})
		}
		if(colOneHeight < colTwoHeight) {
			$('.photo_set').css({'background':'url('+randomImage+') left 0px bottom 10px no-repeat','background-size':'50%'})
		}
	}
	//on photo in photo river click
	function photoClick() {
		$('.photo_set img').click(function() {
			if($('#mobiletrue:visible').length == 0){
				//$('header').animate({'width':'240px'},{easing: 'linear', duration: 300, queue: false});
				//$('.logo').animate({'width':'200px'},{easing: 'linear', duration: 300, queue: false});
			}
			var imgSrc = $(this).attr('src');
			var imgTitle = $(this).attr('alt');
			$('.home .screen').html('<div class="img_container"><div class="btn_close btn_close_img" alt="close">close x</div><div class="title">'+imgTitle+'</div><img src="'+imgSrc+'" /></div>').fadeIn(300);
			$('.btn_close_img').click(function() {
				if($('#mobiletrue:visible').length == 0){
					//$('header').animate({'width':'435px'},{easing: 'linear', duration: 300, queue: false});
					//$('.logo').animate({'width':'335px'},{easing: 'linear', duration: 300, queue: false});
				}
				$('.home .screen').fadeOut(300);
			});
		});
	}
	//find time left for resuming anumation after pause
	function findNewTime() {
		var marginTop = $('.photo_river').css('margin-top');
		var marginTopArray = marginTop.split('px');
		marginTop = parseFloat(marginTopArray[0]);
		resumeTime = (riverDuration*(parseFloat(riverHeight)+marginTop))/riverHeight;
	}
	//animate River second time
	function moveRiverAgain(time) {
		evenColumns();
		$('.photo_river').append(riverHtml);
		riverTime = 0;
		//window.setInterval(function() {riverTime = riverTime+100;}, 100);
		$('.photo_river').unbind().animate({'margin-top':'-'+riverHeight+'px'}, {easing: 'linear', duration: time, complete: function() {
			$('.photo_river').css('margin-top','0px');
			$('.photo_set:first').remove();
			moveRiver(riverDuration);
		}});
		$('.photo_river').mouseenter(function() {
			findNewTime();
			$(this).stop();
			photoClick();
			$(this).mouseleave(function() {
				moveRiver(resumeTime);
				$('.photo_set:last').remove();
			});
		});
	}
	//animate River
	function moveRiver(time) {
		evenColumns();
		$('.photo_river').append(riverHtml);
		riverTime = 0;
		//window.setInterval(function() {riverTime = riverTime+100;}, 100);
		$('.photo_river').unbind().animate({'margin-top':'-'+riverHeight+'px'}, {easing: 'linear', duration: time, complete: function() {
			$('.photo_river').css('margin-top','0px');
			$('.photo_set:first').remove();
			moveRiverAgain(riverDuration);
		}});
		$('.photo_river').mouseenter(function() {
			findNewTime();
			$(this).stop();

			photoClick();
			$(this).mouseleave(function() {
				moveRiverAgain(resumeTime);
				$('.photo_set:last').remove();
			});
		});
	}
	//moveRiver function called on window load
	$(window).load(function() {
		//evenColumns();
		riverHeight = $('.photo_river').height();
		riverDuration = riverHeight*15;
		moveRiver(riverDuration);
	});
