$(document).ready(function() {

// Remove the failure class from any input, select or textarea when focussed
$('.required').focus(function() {
	$(this).removeClass('error');
});

//FISHBOWL FORM
$('#fishbowl').on('submit', function (event) {
	event.preventDefault();

	var noFlags = true;
	// Iterate through required fields
	$(this).find(".required").each(function () {
		// remove any previously applied error classes
		$(this).removeClass('error');
		// if the field is blank...
		if (!$.trim($(this).val())) {
			// add error class
			$(this).addClass('error');
			// No flags is now false, form won't submit
			noFlags = false;
		}
	});

	var FirstName = $('#fbfirstname').val();
	var LastName = $('#fblastname').val();
	var EmailAddress = $('#fbemail').val();
	var MobilePhone = $('#fbmobile').val();
	var Birthdate = $('#fbbirthmonth').val()+'/'+$('#fbbirthday').val();
	var Address = $('#fbaddress').val();
	var Address2 = $('#fbaddress2').val();
	var Zip = $('#fbzip').val();
	var SMSOptIn = 'FALSE';
	if($('#fbSMSOptIn').is(':checked')) {
		SMSOptIn = 'TRUE';
	}

	var SiteGUID = $('#fbSiteGUID').val();
	var StoreCode = $('#fbStoreCode').val();
	var postTo = $('#fbpostTo').val();
	var ListID = $('#fbListID').val();
	var SiteURL = $('#fbSiteURL').val();

	//if missing an @ or a .
	if(!isValidEmailAddress(EmailAddress)) {
		$('#fbfemail').addClass('error');
	}
	//if mobile number entered but optin not checked
	if ( MobilePhone !== '' && !$('#fbSMSOptIn').is(":checked") ) {
		$('#fbSMSOptIn').addClass('error');
	}

	//store our post content into a var
	var dataString = 'FirstName='+ FirstName + '&LastName='+ LastName + '&EmailAddress=' + EmailAddress + '&MobilePhone='+ MobilePhone + '&SMSOptIn='+ SMSOptIn + '&Birthdate='+ Birthdate + '&Address='+ Address + '&Address2='+ Address2 + '&zip='+ Zip + '&SiteGUID=' + SiteGUID + '&ListID=' + ListID + '&StoreCode=' + StoreCode + '&Action=subscribe&automessage_fromline=EmailSignUp&automessage_fromaddress=EmailSignUp&InputSource=WEB';

	if (noFlags) {
		$.ajax({
			type: "POST",
			url: postTo,
			dataType: "xml",
			data: dataString
		}); 
		$('#fishbowl').html('<p class="fisbowl-thank-you">Thanks for Signing Up!<iframe src="'+SiteURL+'?page=Email-Sign-Up" height="1" width="1" style="height: 1px; width: 1px; border: none; float: left; clear: left;"></p>');
		return false;
		}
});

}); //end doc ready

